    "2016-07-27T22:52:45.647628",nt"name": "swan-river-national-wildlife-refuge-narrative-report-fiscal-year-75-july-1-1974-to-june-30",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Swan River
    National Wildlife Refuge outlines Refuge accomplishments during the 1974 fiscal
    year. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover conditions during the year. Wildlife- including
    migratory birds, upland game birds, big game animals, predators, raptors, and fish-
    is also covered. The Refuge development and maintenance section discusses physical
    developments. Resource management is outlined; topics include grazing. The public
    relations section of the report describes recreational uses, Refuge participation,
    hunting, fishing, and safety. N-R forms and photographs are attached.",nt"license_title":
